import {
  Box,
  Divider,
  ListItem,
  ListItemIcon,
  ListItemText,
  Typography,
  withStyles,
} from "@material-ui/core";
import { InfoOutlined } from "@material-ui/icons";

export default function UserDetail({ userInfo }) {
  return (
    <Container>
      <Heading variant="h6">Your Attempts</Heading>

      <UserDetailContainer>
        <SingleUserDetail>
          <InfoOutlined />
          <UserDetailedText>

          </UserDetailedText>

        </SingleUserDetail>
      </UserDetailContainer>

      <Divider />
    </Container>
  );
}

const Container = withStyles({
  root: {
    display: "flex",
    flexDirection: "column",
  },
})(Box);

const Heading = withStyles({
  root: {
    fontWeight: 600,
    margin: "0.5rem 0",
  },
})(Typography);

const UserDetailContainer = withStyles({
  root: {
    display: "flex",
    flexDirection: "column",
    margin: "1rem 0",
  },
})(Box);

const SingleUserDetail = withStyles({
  root: {
    display: "flex",
    alignItems: "center",
  },
})(Box);

const UserDetailText = withStyles({
  root: {
    margin: "0 0 0 0.5rem",
    whiteSpace: "nowrap",
  },
})(Typography);
